import React from 'react';
import { withRouter } from "react-router";

const HomePageView = props => {
  return (
    <div>
      <Link to="/campuses" className="btn btn-primary">Campuses</Link>
      <button onClick={() => { this.props.history.push('/campuses')} }>All Campuses</button>
      <button onClick={() => { this.props.history.push('/students')} }>All Students </button>
    </div>
  );
};

export default withRouter(HomePageView);
